import { useParams } from 'react-router-dom';

const MovieDetails = () => {
  const { movieId } = useParams<{ movieId: string }>();

  return (
    <div className="container mt-4">
      <h2>Movie Details</h2>
      <p>Details for movie ID: {movieId}</p>
      {/* Fetch and display movie details here */}
    </div>
  );
};

export default MovieDetails;
